,p_process_name=>'Load User From API'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'  l_resp clob;',
'begin',
'  l_resp := apex_web_service.make_rest_request(',
'    p_url         => ''https://g72e895f580b78d-du9gypcf1cci20nt.adb.sa-saopaulo-1.oraclecloudapps.com/ords/comagol/poc/v1/users/'' || :P11_ID,',
'    p_http_method => ''GET''',
'  );',
'',
'  apex_json.parse(l_resp);',
'',
'  -- For GET by id with Query One Row',
'  :P11_EMAIL      := apex_json.get_varchar2(''email'');',
'  :P11_FIRST_NAME := apex_json.get_varchar2(''firstName'');',
'  :P11_LAST_NAME  := apex_json.get_varchar2(''lastName'');',
'  :P11_STATUS     := apex_json.get_varchar2(''status'');',
'exception',
'  when others then',
'    raise_application_error(-20060, ''Failed to load user: '' || sqlerrm);',
'end;'))
,p_process_clob_language=>'PLSQL'
,p_internal_uid=>8865737927650415
);
wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(8865816531650416)
,p_process_sequence=>10
,p_process_point=>'ON_SUBMIT_BEFORE_COMPUTATION'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'Update User Via API'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare',
'  l_body        clob;',
'  l_resp        clob;',
'  l_url         varchar2(4000);',
'  l_status_code number;',
'begin',
'  if :P5_ID is null then',
'    raise_application_error(-20070, ''P5_ID is null. Cannot update user.'');',
'  end if;',
'',
'  l_url := ''https://g72e895f580b78d-du9gypcf1cci20nt.adb.sa-saopaulo-1.oraclecloudapps.com/ords/comagol/poc/v1/users/'' || :P5_ID;',
'',
'  l_body :=',
'    ''{'' ||',
'      ''"firstName":"'' || replace(:P5_FIRST_NAME,''"'',''\"'') || ''",'' ||',
'      ''"lastName":"''  || replace(:P5_LAST_NAME,''"'',''\"'')  || ''",'' ||',
'      ''"status":"''    || upper(:P5_STATUS)                || ''"''  ||',
'    ''}'';',
'',
'  apex_web_service.g_request_headers.delete;',
'  apex_web_service.g_request_headers(1).name  := ''Content-Type'';',
'  apex_web_service.g_request_headers(1).value := ''application/json'';',
'  apex_web_service.g_request_headers(2).name  := ''Accept'';',
'  apex_web_service.g_request_headers(2).value := ''application/json'';',
'',
'  l_resp := apex_web_service.make_rest_request(',
'    p_url         => l_url,',
'    p_http_method => ''PUT'',',
'    p_body        => l_body',
'  );',
'',
'  l_status_code := apex_web_service.g_status_code;',
'',
'  if l_status_code not in (200, 201) then',
'    raise_application_error(',
'      -20071,',
'      ''PUT failed. HTTP='' || l_status_code || '' Response='' || substr(l_resp,1,1500)',
'    );',
'  end if;',
'',
'  apex_application.g_print_success_message := ''User updated via API.'';',
'end;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(8865585227650413)
,p_internal_uid=>8865816531650416
);
