'  l_resp        clob;',
'  l_status_code number;',
'begin',
'  l_body :=',
'    ''{'' ||',
'      ''"email":"''     || lower(replace(:P8_EMAIL,''"'',''\"''))       || ''",'' ||',
'      ''"firstName":"'' || replace(:P8_FIRST_NAME,''"'',''\"'')         || ''",'' ||',
'      ''"lastName":"''  || replace(:P8_LAST_NAME,''"'',''\"'')          || ''",'' ||',
'      ''"status":"''    || upper(nvl(:P8_STATUS,''ACTIVE''))          || ''"''  ||',
'    ''}'';',
'',
'  apex_web_service.g_request_headers.delete;',
'  apex_web_service.g_request_headers(1).name  := ''Content-Type'';',
'  apex_web_service.g_request_headers(1).value := ''application/json'';',
'  apex_web_service.g_request_headers(2).name  := ''Accept'';',
'  apex_web_service.g_request_headers(2).value := ''application/json'';',
'',
'  l_resp := apex_web_service.make_rest_request(',
'    p_url         => ''https://g72e895f580b78d-du9gypcf1cci20nt.adb.sa-saopaulo-1.oraclecloudapps.com/ords/comagol/poc/v1/users/'',',
'    p_http_method => ''POST'',',
'    p_body        => l_body',
'  );',
'',
'  l_status_code := apex_web_service.g_status_code;',
'',
'  if l_status_code not in (200, 201) then',
'    raise_application_error(',
'      -20080,',
'      ''POST failed. HTTP='' || l_status_code || '' Response='' || substr(l_resp, 1, 1500)',
'    );',
'  end if;',
'',
'  apex_application.g_print_success_message := ''User created successfully via API.'';',
'exception',
'  when others then',
'    raise_application_error(-20081, ''Create User API failed: '' || sqlerrm);',
'end;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
